import React, { Component } from 'react';
import Button from './Button';



class ButtonGroup extends Component {

    updateDisplay = text => {
        console.log(text)
    }

    render () {
        return(
            <div className = "button-group">
                <Button text = "AC" classes = "button span-two number" />
                <Button text = "DEL" classes = "button number" />
                <Button text = "/" classes = "button operation" />
                <Button text = "1" classes = "button number" updateDisplay = {this.updateDisplay} />
                <Button text = "2" classes = "button number" />
                <Button text = "3" classes = "button number" />
                <Button text = "x" classes = "button operation" />
                <Button text = "4" classes = "button number" />
                <Button text = "5" classes = "button number" />
                <Button text = "6" classes = "button number" />
                <Button text = "+" classes = "button operation" />
                <Button text = "7" classes = "button number" />
                <Button text = "8" classes = "button number" />
                <Button text = "9" classes = "button number" />
                <Button text = "-" classes = "button operation" />
                <Button text = "." classes = "button number" />
                <Button text = "0" classes = "button number" />
                <Button text = "=" classes = "button span-two equals" />
            </div>
        )
    }
}

export default ButtonGroup;
